import React from 'react';
import ReactDOM from 'react-dom';


const Header = (props) => {
    console.log(props)
    return <h1>{props.course}</h1>
}

const Part = (props) => {
    return(
        <div>
            <p>
            {props.part} {props.num}
            </p>
        </div>
    )
}

const Content = (props) => {
    console.log(props)
    return(
        <div>
            <Part part={props.part1} num={props.num1}/>
            <Part part={props.part2} num={props.num2}/>
            <Part part={props.part3} num={props.num3}/>
        </div>
    )
}

const Total = (props) => {
    return(
        <div>
            <p>
               Number of exercises {props.num1 + props.num2 + props.num3} 
            </p>
        </div>
    )

}

const App = () => {
    const course = 'Half Stack application development'

    const parts = [
      {
        name: 'Fundamentals of React',
        exercise: 10
      },
      {
        name: 'Using props to pass data',
        exercise: 7
      },
      {
        name:'State of a component',
        exercise: 14
      }
    ]    
    return (
      <div>
        <Header course={course} />
        <Content part1={parts[0].name} part2={parts[1].name} part3={parts[2].name} num1={parts[0].exercise} num2={parts[1].exercise} num3={parts[2].exercise}/>
        <Total num1={parts[0].exercise} num2={parts[1].exercise} num3={parts[2].exercise}/>
      </div>
    )
  }



ReactDOM.render(<App />, document.getElementById('root'));
